import styled from "styled-components";


export const Content = styled.div`
.listItem{
    min-width: 20rem;
    max-width: 20rem;
    min-height: 20rem;
    max-height: 20rem;
    display: inline-block;
    margin:0.8rem;
    background-color: blue;
    img{
        max-width: 10rem;
        min-width: 10rem;
        min-height: 10rem;
        max-height: 10rem;
        object-fit: cover;
        border-radius: 0.5rem;
    }
    p{
        margin: 0.2rem;
        font-size: 0.9rem;
        font-weight: bold;
    }
}
`
